Aggregating records by $group - condition 1 or condition 2<p>I have a database of about 50k &quot;company&quot; records.</p>
<p>I want to find duplicates by matching:</p>
<ol>
<li><code>name</code> and <code>street</code> fields.</li>
</ol>
<p>OR</p>
<ol start="2">
<li><code>phone</code> field</li>
</ol>
<p>(I consider both #1 and #2 unique identifiers, so either can be used to find duplicates.)</p>
<p>I am able to write the $group statement to match based on #1:</p>
<pre><code>  _id: {
    name: '$name',
    street: 'street'
  },
  uniqueIds: {
    $addToSet: '$_id'
  },
  count: {
    $sum: 1
  }
</code></pre>
<p>I tried something like this to match one or the other:</p>
<pre><code>
_id: { 
 $or: [
  {name: '$name', street: '$street'},
  {phone: '$phone}
 ]
}...
</code></pre>
<p>But that just returns a boolean.</p>
<p>How to group by filtering for #1 or #2 above in the same aggregation?</p>

