Is it possible for someone log into MongoDB without the correct password if authentication is enabled?<p>I recently setup my first MongoDB database in an production environment. I looked up some guides for deployment and followed them.</p>
<p>I had the following in my config:</p>
<pre><code># Where and how to store data.
storage:
  dbPath: /var/lib/mongodb
  journal:
    enabled: true
#  engine:
#  mmapv1:
#  wiredTiger:

# where to write logging data.
systemLog:
  destination: file
  logAppend: true
  path: /var/log/mongodb/mongod.log

# network interfaces
net:
  port: 27017
  bindIp: 127.0.0.1


# how the process runs
processManagement:
  timeZoneInfo: /usr/share/zoneinfo

security:
  authorization: &quot;enabled&quot;
</code></pre>
<p>And I created an admin user (the only user) that looks like this:</p>
<pre><code>{
&quot;_id&quot; : &quot;admin.admin&quot;,
&quot;userId&quot; : UUID(&quot;6dfe010f-1e62-4801-9c07-5a408b8c75c6&quot;),
&quot;user&quot; : &quot;admin&quot;,
&quot;db&quot; : &quot;admin&quot;,
&quot;credentials&quot; : {
    [omitted, but contains SCRAM-SHA-1 and SCRAM-SHA-256 hashes]
},
&quot;roles&quot; : [
    {
        &quot;role&quot; : &quot;userAdminAnyDatabase&quot;,
        &quot;db&quot; : &quot;admin&quot;
    },
    {
        &quot;role&quot; : &quot;readWriteAnyDatabase&quot;,
        &quot;db&quot; : &quot;admin&quot;
    },
    {
        &quot;role&quot; : &quot;dbAdminAnyDatabase&quot;,
        &quot;db&quot; : &quot;admin&quot;
    }
]
</code></pre>
<p>I also switched the outward facing port for the database (through nginx) to a nearby port that wasn't the default.</p>
<p>With all of that, I still got hacked and I was greeted with <a href="https://i.stack.imgur.com/VMj3a.png" rel="nofollow noreferrer">this</a> when I got onto nosqlbooster.</p>
<p>Fortunately for me, I wasn't storing any sensitive information (just an aggregation of data pulled from a variety of other services) and all of the data can easily be regenerated. However, I'd rather not have this type of thing happen again.</p>
<p>I did some digging in the logs and found the moment they connected:</p>
<pre><code>{
  &quot;t&quot;: {
    &quot;$date&quot;: &quot;2021-02-04T22:10:38.614+00:00&quot;
  },
  &quot;s&quot;: &quot;I&quot;,
  &quot;c&quot;: &quot;ACCESS&quot;,
  &quot;id&quot;: 20250,
  &quot;ctx&quot;: &quot;conn75191&quot;,
  &quot;msg&quot;: &quot;Successful authentication&quot;,
  &quot;attr&quot;: {
    &quot;mechanism&quot;: &quot;SCRAM-SHA-256&quot;,
    &quot;principalName&quot;: &quot;admin&quot;,
    &quot;authenticationDatabase&quot;: &quot;admin&quot;,
    &quot;client&quot;: &quot;127.0.0.1:39722&quot;
  }
}{
  &quot;t&quot;: {
    &quot;$date&quot;: &quot;2021-02-04T22:11:21.521+00:00&quot;
  },
  &quot;s&quot;: &quot;I&quot;,
  &quot;c&quot;: &quot;NETWORK&quot;,
  &quot;id&quot;: 51800,
  &quot;ctx&quot;: &quot;conn75192&quot;,
  &quot;msg&quot;: &quot;client metadata&quot;,
  &quot;attr&quot;: {
    &quot;remote&quot;: &quot;127.0.0.1:39918&quot;,
    &quot;client&quot;: &quot;conn75192&quot;,
    &quot;doc&quot;: {
      &quot;driver&quot;: {
        &quot;name&quot;: &quot;PyMongo&quot;,
        &quot;version&quot;: &quot;3.11.2&quot;
      },
      &quot;os&quot;: {
        &quot;type&quot;: &quot;Linux&quot;,
        &quot;name&quot;: &quot;Linux&quot;,
        &quot;architecture&quot;: &quot;x86_64&quot;,
        &quot;version&quot;: &quot;5.8.0-41-generic&quot;
      },
      &quot;platform&quot;: &quot;CPython 3.8.6.final.0&quot;
    }
  }
}
</code></pre>
<p>Shortly after that login, I can see them drop my database and insert the note. Funny enough, it looks like they never saved the data, so the whole thing is obviously a scam. I also checked the <code>auth.log</code> for the server to ensure that nobody logged into the server itself, so I'm pretty sure they haven't tampered with the filesystem unless they did some magic through nginx.</p>
<p>I did some testing with authentication off and found that you <em>can</em> have an &quot;authenticated&quot; connection with the incorrect password if authentication is off. At this point, my question is: Are there any ways to get in without knowing the password if my config is set as specified above and my mongo server has been restarted since the last configuration change? Or is the only possibility that they have my password? I'm completely stumped. Around a week before the attack, I tried logging in with incorrect passwords to ensure that authorization was enabled correctly. I got denied as expected.</p>
<p>In case it's relevant, here's the rule for my MongoDB port in Nginx:</p>
<pre><code>stream {
    server {
        listen  27018;
        proxy_connect_timeout 1s;
        proxy_timeout 3s;
        proxy_pass    stream_mongo_backend;
    }

    upstream stream_mongo_backend {
        server 0.0.0.0:27017;
    }
}
</code></pre>

