  ...
}
</code></pre>
<p>Whenever I log <code>Post.attachments</code> everything works fine, it shows that there are items in the array but when the <code>.map(...)</code> ends and I log the array afterwards nothing seems to work.</p>
<p>Hope we'll be able to resolve this issue and understand why this happens.
Thank you</p>

